import passport from 'passport';
import LocalStrategy from 'passport-local';
import JWTStrategy from 'passport-jwt/lib/strategy';
import ExtractJWT from 'passport-jwt/lib/extract_jwt';

import UserStore from './stores/user';

passport.use(
	new LocalStrategy(
		{
			usernameField: 'email',
			passwordField: 'password',
			session: false
		},
		async (email, password, done) => {
			try {
				const userCtx = await UserStore.getUserCtxFromEmail(email);
				if (userCtx) {
					const couchLoginDetails = {
						name: userCtx.name,
						password
					};
					if (
						await UserStore.isCredentialsCorrect(couchLoginDetails)
					) {
						return done(null, userCtx, {
							ok: true,
							mes: 'Authenticated Successfully'
						});
					}
				}

				return done(null, false, {
					err: true,
					mes: 'Incorrect email or password'
				});
			} catch (e) {
				done(e);
			}
		}
	)
);

passport.use(
	new JWTStrategy(
		{
			jwtFromRequest: ExtractJWT.fromAuthHeaderAsBearerToken(),
			secretOrKey: 'jwtkey'
		},
		async (payload, done) => {
			const userCtx = await UserStore.getUserCtxFromEmail(payload.email);
			if (userCtx && userCtx.name === payload.name) {
				return done(null, userCtx, {
					ok: true,
					mes: 'Logged in ',
					userCtx
				});
			}
			return done(null, false, {
				err: true,
				mes: 'Invalid token user not found',
				email: payload.email
			});
		}
	)
);

