import express from 'express';
import passport from 'passport';
import httpProxy from 'http-proxy';

const couchProxy = httpProxy.createProxyServer();

const couchRouter = express.Router();

couchRouter.all('/user_db/*', (req, res, next) => {
	passport.authenticate('jwt', { session: false }, (err, user, info) => {
		if (err) {
			res.status(400).json(err);
			next();
		}
		if (info.hasOwnProperty('message')) {
			info = {
				err: true,
				mes: info.message
			};
		}
		if (info.err) {
			res.status(200).json({ ...info });
			next();
		}
		console.log(req.params.userId);
		couchProxy.web(req, res, {
			target: `http://odin:password@localhost:5984/userdb-${
				info.userCtx.name
			}`
		});
	})(req, res, next);
});

export default couchRouter;

